import React from "react";

const Header = () => {
  return (
    <div className="bg-gray-200 ">
      <h1>
        <img src="/logo.png" alt="Logo" className="h-24 py-4 mx-auto" />
      </h1>
      <div className="bg-gray-500">Navbar</div>
    </div>
  );
};

export default Header;
